import React from 'react';
import './style.css';

function AboutMe(){
    return(
        <div id='AboutMeBackGround'>
            <h1 className='text-center'>Teresa Liu</h1>
            <h2 className='text-center'>About Me</h2>
            <p>Full Stack Web Developer with a background in business and document management. Like challenges and personal and professional growth. Moved from Taiwan to Seattle in 2018. Never stopped learning and exploring out of my comfort zone. Bachelor degree in English and certified  in full stack web development. Recently created a full stack app that allows users to search and save books from using Google book API.</p>

        </div>
    )
}

export default AboutMe ;
